package main

import (
	"fmt"
	"io/ioutil"
	"net/http"
	"net/url"
)

func httpPostForm() {
	resp, err := http.PostForm("http://218.60.147.62:8017/xmglgs/ListView.aspx?pl=NPZP",
		url.Values{"__EVENTTARGET": {"gvPL$ctl21$lbtnPL"}, "__EVENTARGUMENT": {""}, "__VIEWSTATE": {""}, "__EVENTVALIDATION": {""}})
	if err != nil {
		// handle error
		fmt.Println(err)
	}
	defer resp.Body.Close()
	body, err := ioutil.ReadAll(resp.Body)
	if err != nil {
		// handle error
		fmt.Println(err)
	}
	fmt.Println(string(body))
}

func main() {
	httpPostForm()
}
